import React, { useState } from 'react';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import { styled, alpha } from '@mui/material/styles';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import InputBase from '@mui/material/InputBase';
import { Button, Drawer, List, ListItem, ListItemText } from '@mui/material';
import Stack from '@mui/material/Stack';
import logo from '../assets/techcareer-logo.svg';
import useMediaQuery from '@mui/material/useMediaQuery';

const Search = styled('div')(({ theme }) => ({
  position: 'relative',
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.black, 0.15),
  '&:hover': {
    backgroundColor: alpha(theme.palette.common.black, 0.25),
  },
  marginRight: theme.spacing(2),
  marginLeft: theme.spacing(2),
  width: 'auto',
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: 'inherit',
  '& .MuiInputBase-input': {
    padding: theme.spacing(1, 1, 1, 0),
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    width: '100%',
    transition: theme.transitions.create('width'),
  },
}));

export default function PrimarySearchAppBar() {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const isMobile = useMediaQuery('(max-width:768px)');

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setDrawerOpen(open);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{ backgroundColor: 'white' }}>
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={toggleDrawer(true)}
            sx={{ mr: 2, display: { md: 'none' } }} // Sadece mobilde g√∂ster
          >
            <MenuIcon />
          </IconButton>
          <Drawer anchor="left" open={drawerOpen} onClose={toggleDrawer(false)}>
            <List sx={{ width: 250 }}>
              <ListItem button onClick={toggleDrawer(false)}>
                <ListItemText primary="Ana Sayfa" />
              </ListItem>
              <ListItem button onClick={toggleDrawer(false)}>
                <ListItemText primary="Buton 1" />
              </ListItem>
              <ListItem button onClick={toggleDrawer(false)}>
                <ListItemText primary="Buton 2" />
              </ListItem>
              <ListItem button onClick={toggleDrawer(false)}>
                <ListItemText primary="Buton 3" />
              </ListItem>
              <ListItem button onClick={toggleDrawer(false)}>
                <Button variant="outlined" sx={{ color: 'black' }}>
                  Giri≈ü/√úye
                </Button>
              </ListItem>
            </List>
          </Drawer>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <a href="../Pages/Home">
              <img src={logo} alt="logo" width="200px" height="25px" />
            </a>
          </Box>
          {!isMobile && (
            <>
              <Search>
                <SearchIconWrapper>
                  <SearchIcon />
                </SearchIconWrapper>
                <StyledInputBase
                  placeholder="Etkinlik, ƒ∞≈ü ilanƒ±, Blog ara"
                  inputProps={{ 'aria-label': 'search' }}
                />
              </Search>
              <Box sx={{ flexGrow: 1 }} />
              <Stack spacing={2} direction="row" sx={{ mr: 8 }}>
                <Button variant="text" sx={{ color: 'black' }}>Buton 1</Button>
                <Button variant="text" sx={{ color: 'black' }}>Buton 2</Button>
                <Button variant="text" sx={{ color: 'black' }}>Buton 3</Button>
                <Button variant="outlined" sx={{ color: 'black' }}>Giri≈ü/√úye</Button>
              </Stack>
            </>
          )}
        </Toolbar>
      </AppBar>
    </Box>
  );
}
